window.bookSummaryJSON = "<p><b>Killing machines. Shadow organizations. A desperate attempt to stay sane.</b></p> <p>After failing the most important exam of his life, Kyle is forced into a VR war. Now, he fights on the front lines as cannon fodder for what he always assumed was the government, losing a little part of his memories with every virtual death.</p> <p>When the mission heâ€™s on goes wrong, Kyle is stranded on a planet far from his original destination. Finally given a chance to make an impression in the organization, Kyle will have to risk his mind for a chance at salvation.</p> <p>If he fails, he'll lose all will to resist: making him the perfect soldier.</p> <p><i>Winter Harvest </i>is audiobook one of four in the Space Seasons series, a LitRPG sci-fi space opera set on another world with mechs, spaceships, levels, and...well...pure evil.</p>"; 
